    coreBrowser.JavaScript['object_create'] = function(block) {
      if (!block.numFields) {
          return ['{}', coreBrowser.JavaScript.ORDER_NONE];
      }
      
      var fieldInitCode = '';
      for (var i = 1; i <= block.numFields; i++) {
          if (i > 1) { 
              fieldInitCode += ', '; 
          }
          
          const fieldName = block.getFieldValue('field' + i);
          const fieldValue = coreBrowser.JavaScript.valueToCode(block, 'field_input' + i, coreBrowser.JavaScript.ORDER_ATOMIC);
          fieldInitCode += '"' + fieldName + '": ' + fieldValue;
      }
      var code = '{ ' + fieldInitCode + ' }';

      return [code, coreBrowser.JavaScript.ORDER_NONE];
    };

